INSERT INTO `page` (`id`, `title`, `title_ar`, `description`, `description_ar`) VALUES
(1, 'Privacy Policy and Usage', 'سياسة الخصوصية والاستخدام ', 'The privacy policy governs the method in which "Express Maintenance" collects, uses, preserves and declares information collected by users of the Express Maintenance application. This privacy policy applies in the application and all products and services provided by the Express maintenance.\r\nPersonal identification information\r\nExpress Maintenance collects personal identity information from users in various ways, including, but not limited to, the times of the user’s visit to the application, registration in the Express maintenance application, filling in the request, the questionnaire analysis form, and other activities, services, features or resources that we may provide on Our application. Users may be required to fully clarify their name, email address, phone number, and credit card information.\r\nNon-personally identifiable information:\r\nExpress maintenance collects some information about users whenever they interact with the application, and this information is not related to personal identity, but may include the type of smartphone and technical information about the user''s contact methods with the application, such as the company used to provide the Internet service and other similar information.\r\nHow we use the information collected:\r\nExpress Maintenance collects and uses users'' personal information for the following purposes:\r\nImproving the quality of customer service.\r\nYour information helps us to easily respond to your customer service requests and support needs more effectively.\r\n• To improve the application.\r\nWe are constantly striving to improve the offers made through the application or our website according to the information and feedback we receive from you.\r\n• Sending e-mails periodically.\r\nThe email address that users register to process their request, will only be used to send them information and updates related to their request. It may also be used in response to inquiries, or other requests or questions.\r\nHow do we protect your information:\r\nWe follow proper procedures and safety standards in collecting, storing and dealing with data, in order to protect that data against unauthorized handling, modification, disclosure or destruction of your personal data, username, password, information related to your transactions and the data stored on our application. The exchange of sensitive and private data between the Express maintenance and its users is done through secure communication channels and is encrypted and protected through approved digital methods and methods.\r\nSharing personal data:\r\nWe at Express Maintenance do not sell, trade, or rent users'' personal identification data to third parties, and we may share general aggregated demographic information that is not linked to any information about the personal identity of visitors and users with our partners, affiliates and advertisers for the purposes described above. We may use a third-party service provider to assist us in running our business and also in making the application or managing activities on our behalf, such as sending newsletters or surveys. We may share your data with this third party within the limits of those specified purposes in the event that you have given us permission to do so.\r\nThird party websites:\r\nUsers may find advertisements or other content on our app carrying links to the sites and services of our partners, suppliers, advertisers, sponsors, licensors, or other third-party entities. It should be noted that we do not control the content or links that appear on those sites and we are not responsible for the practices of the sites linked to our site. In addition, those sites or services, including their content and links, may change constantly. These sites and services will have their own privacy policies and customer service policies. Also, browsing and interacting on any other site, including sites that link to our application, are subject to the terms and policies of those sites.\r\nAgree to the terms of use:\r\nYour use of this application indicates your agreement to our privacy policy and the controls and conditions governing the use of this application. If you do not agree to this policy, you must not use our app. You acknowledge that your continued use of the application after announcing the changes to this policy or to the controls and terms of use of the application will be considered as your acceptance of these changes.\r\nto contact us :\r\nIf you have any questions about this privacy policy, the practices in this application, or your dealings with the application, you can contact us through our communication channels.', 'تحكم سياسة الخصوصية الأسلوب الذي تقوم به ” صيانة اكسبريس ” بجمع، واستخدام، والحفاظ والتصريح بالمعلومات التي تم جمعها من قبل مستخدمين تطبيق صيانة اكسبريس وتطبق سياسة الخصوصية هذه في التطبيق وكافة المنتجات والخدمات المقدمة من صيانة اكسبريس.\r\nمعلومات الهوية الشخصية \r\nيقوم صيانة اكسبريس بجمع معلومات عن الهوية الشخصية من المستخدمين بطرق مختلفة، وتشمل ولا تقتصر فقط على أوقات زيارة المستخدم للتطبيق، التسجيل في تطبيق صيانة اكسبريس ، ملىء الطلب، نموذج تحليل الإستبيان، وغير ذلك من الأنشطة، والخدمات، والميزات أو المصادر التي قد نوفرها على تطبيقنا. قد يُطلب من المستخدمين توضيح الاسم بشكل كامل، وعنوان البريد الإلكتروني، ورقم الهاتف، وبيانات بطاقة الائتمان.\r\nمعلومات لا تتعلق بالهوية الشخصية :\r\nيقوم صيانة اكسبريس بجمع بعض المعلومات عن المستخدمين اينما تفاعلوا مع التطبيق, وهذه المعلومات لا تتعلق بالهوية الشخصية انما قد تتضمن نوع الهاتف الذكي و معلومات تقنية عن اساليب إتصال المستخدم بالتطبيق, مثل الشركة المستخدمة لتقديم خدمة الانترنت وغيرها من المعلومات المشابهة.\r\nكيف نقوم باستخدام المعلومات التي تم جمعها :\r\nيقوم صيانة اكسبريس بجمع واستخدام المعلومات الشخصية للمستخدمين في الأغراض التالية:\r\n• تحسين جودة خدمة العملاء.\r\nتساعدنا المعلومات الخاصة بك على سهولة الاستجابة لطلباتك الموجهة لخدمة العملاء واحتياجاتك للدعم بشكل أكثر فاعلية.\r\n• لتحسين التطبيق.\r\nنسعى باستمرار لتحسين العروض المقدمة من خلال التطبيق او موقعنا الالكتروني وفقاً للمعلومات والملاحظات التي نتلقاها منك.\r\n• إرسال رسائل الكترونية بشكل دوري.\r\nعنوان البريد الالكتروني الذي يسجله المستخدمون للتعامل مع طلبهم، سوف يستخدم فقط في إرسال معلومات وتحديثات لهم تتعلق بطلبهم. وقد يُستخدم أيضاً في الاستجابة للاستفسارات، أو غيرها من الطلبات أو الأسئلة. وإذا قرر المستخدم الانضمام إلى قائمة مراسلاتنا، فإنه سوف يتلقى رسائل على بريده الإلكتروني قد تتضمن أخبار صيانة اكسبريس ، آخر التحديثات، ومعلومات تتعلق بالتطبيق. وإذا أراد المستخدم في أي وقت إلغاء تسجيل تلقي أي رسائل مستقبلية، فإننا نقدم له توجيهات مفصلة حول إلغاء التسجيل في نهاية كل رسالة على بريده الالكتروني، او يمكن للمستخدم التواصل معنا من خلال التطبيق او موقعنا الالكتروني.\r\nكيف نقوم بحماية معلوماتك :\r\nنحن نتبع الإجراءات السليمة ومعايير الأمان في جمع وحفظ والتعامل مع البيانات، وذلك لحماية تلك البيانات ضد التعامل غير المصرح به، أو التعديل، أو الإفصاح أو إتلاف بياناتك الشخصية، واسم المستخدم، وكلمة المرور، ومعلومات تخص تعاملاتك والبيانات المخزنة على تطبيقنا. يتم تبادل البيانات الحساسة والخاصة بين صيانة اكسبريس ومستخدميه من خلال قنوات اتصال مؤمنة ويتم تشفيرها وحمايتها من خلال طرق وأساليب رقمية معتمدة.\r\nمشاركة البيانات الشخصية :\r\nنحن في صيانة اكسبريس لا نقوم ببيع، أو المتاجرة، أو تأجير بيانات الهوية الشخصية الخاصة بالمستخدمين إلى جهات أخرى، وقد نشارك المعلومات الديموغرافية العامة المجمعة والتي لا ترتبط بأي معلومات عن الهوية الشخصية الخاصة بالزائرين والمستخدمين مع شركاءنا، والشركات التابعة والمعلنين وذلك للأغراض الموضحة أعلاه. وقد نستخدم طرف ثالث مقدم للخدمة ليساعدنا في تسيير أعمالنا وأيضاً في عمل التطبيق أو في إدارة الأنشطة بالنيابة عنا، مثل إرسال النشرات الإخبارية أو الدراسات الاستقصائية. قد نشارك بياناتك مع هذا الطرف الثالث في حدود تلك الأغراض المحددة في حالة أنك أعطيت لنا إذن بذلك.\r\nالمواقع الخاصة بالطرف الثالث :\r\nقد يجد المستخدمون إعلانات أو غيرها من المحتويات على تطبيقنا تحمل روابط لمواقع وخدمات شركائنا، أو الموردين، أو المعلنين، أو الراعين، أو مانحي التراخيص، أو غيرهم من الكيانات التي تمثل الطرف الثالث. وينبغي العلم بأننا لا نتحكم في المحتوى أو الروابط التي تظهر على تلك المواقع ولسنا مسئولين عن الممارسات التي تقوم بها المواقع المرتبطة بموقعنا. بالإضافة إلى ذلك، فإن تلك المواقع أو الخدمات، وتشمل المحتوى والروابط، قد تتغير باستمرار. وهذه المواقع والخدمات يكون لديها سياسة الخصوصية وسياسات خدمة العملاء الخاصة بها. كما أن التصفح والتفاعل على أي موقع آخر، بما في ذلك المواقع التي تحمل رابط لتطبيقنا، تخضع للشروط والسياسات الخاصة بتلك المواقع.\r\nالتحايل على النظام : \r\nلا يُسمح لأي مستخدم يقوم بالتحايل على النظام من خلال استخدامه ثغره او اخرى في النظام او ميزة استخدمها دون ان يتم الاعلان عن تفاصيلها المستخدمة , وفي حال اكتشاف الثغره على المستخدم مخاطبتنا او الاستفسار عن ذلك , ويحق لصيانة اكسبريس اتخاذ ما يلزم في حال حصول ذلك . \r\nالتغيرات التي تطرأ على سياسة الخصوصية :\r\nتمتلك صيانة اكسبريس حرية التصرف في تحديث سياسة الخصوصية هذه في أي وقت. وعندما نقوم بذلك، على المستخدم مراجعة تاريخ التحديث أسفل هذه الصفحة، وسنقوم بإرسال رسالة على البريد الالكتروني. لذا نحث المستخدمين على مراجعة سياسة الخصوصية بشكل متكرر للاطلاع على أي تغيرات بحيث يكونوا على علم بما نقوم به في سبيل حماية البيانات الشخصية التي نقوم بجمعها. وان يقر ويوافق المستخدم على مسئوليته في مراجعة سياسة الخصوصية هذه بشكل دوري وإدراكه للتعديلات.\r\nالموافقة على شروط الاستخدام :\r\nاستخدامك لهذا التطبيق، يفيد بموافقتك على سياسة الخصوصية المتبعة لدينا والضوابط والشروط التي تحكم استخدام هذا التطبيق. فإذا لم تكن موافقاً على هذه السياسة، يتوجب عليك عدم استخدام تطبيقنا. وإنك تقر بأن استمرار استخدامك للتطبيق بعد إعلان التغييرات التي تطرأ على \r\nهذه السياسة أو على ضوابط وشروط استخدام التطبيق سيعتبر بمثابة موافقة منك على هذه التغييرات.\r\nللتواصل معنا :\r\nإذا كان لديك أي أسئلة بشأن سياسة الخصوصية هذه، أو الممارسات بهذا التطبيق، أو تعاملاتك مع التطبيق، يمكنكم التواصل معنا من خلال قنوات التواصل الخاصة بنا \r\n'),
(2, 'اتفاقية ابطال الصيانة ', 'اتفاقية ابطال الصيانة ', '<p>اتفاقية تعاون</p><p>بعون الله وتوفيقه، تم توقيع اتفاقية التعاون هذه "الاتفاقية" يوم ____ بتاريخ __/__/1441هـ الموافق __/__/_202م بين كل من :</p><ol><li>شركة رواد السرعة للصيانة والقائمة بسجل تجاري رقم 4030438632))، وعنوان مركزها الرئيسي في جدة حي الحمدانية ص.ب 6706  الرمز البريدي 21452,عنوان البريد الالكتروني (ashaikhi@@hotmail.com )، ويمثلها في التوقيع على هذه الاتفاقية السيد/ سعد علي الشيخي بصفته المدير التنفيذي ويشار إليها فيما بعد لأغراض هذه الاتفاقية  بـالطرف الاول.</li><li>______________________ ، سجل تجاري رقم (__________)، وعنوانها ______________جوال رقم: __________، عنوان البريد الإلكتروني __________ جوال __________،ويمثلها في التوقيع</li></ol><p>لسيد / _______هوية رقم _______ ، بصفته ..............</p><p>ويشار إليها فيما بعد لأغراض هذه الاتفاقية  بـ (الطرف الثاني).ويشار إليهما مجتمعين بـ (الطرفان" أو "الطرفين).</p><p>التمهيد</p><p>حيث أن شركة رواد السرعة للصيانة هي شركة تجارية تمتلك تطبيق "صيانة إكسبرس  " والذي هو عبارة عن منصة الكترونية تجمع بين مقدمي خدمات وبين العملاء المستخدمين للتطبيق "التطبيق" ، حيث تسمح لمقدمي خدمة بالاتصال بالعملاء مستخدمي التطبيق وتقديم الخدمات لهم وفقاً لما يتيحه التطبيق. </p><p>وحيث أن الطرف الثاني هو مؤسسة تعمل في مجال تقديم خدمات (.________________________ )، ولديه الخبرة والقدرة والإمكانيات اللازمة لتقديم الخدمات عن طريق تطبيق "صيانة إكسبرس " ، ويرغب في تقديم خدماته من خلال التطبيق الخاص بالطرف الأول "صيانة إكسبرس </p><p>وحيث أبدى الطرفان رغبتهما في التعاون معا فقد اتفقا فيما بينهما على الآتي : </p><ol><li>التمهيد:</li></ol><p> يعتبر التمهيد السابق وأي ملاحق تضاف لهذه الاتفاقية هي جزء لايتجزأ من هذه الاتفاقية يقرأ ويفسر معها.</p><ol><li>موضوع الاتفاقية:</li></ol><p>3-1 اتفق الطرفان على أن تتيح شركة رواد السرعة للصيانة للطرف الثاني عرض وتقديم الخدمات عبر تطبيق "صيانة إكسبرس  " في مقابل أن تحصل على عمولة مقابل أي خدمة يتم تقديمها لعملاء التطبيق، مع التزام الطرف الثاني بشروط تقديم الخدمة المحددة من قبل شركة رواد السرعة للصيانة في هذه الاتفاقية.</p><ol><li>مدة الاتفاقية:</li></ol><p>اتفق الطرفان على أن تكون مدة هذه الاتفاقية سنة واحدة ابتداء من تاريخ التوقيع عليها، ويتم تجديد هذه المدة تلقائياً لمدد أخرى مماثلة ما لم يخطر أحد الطرفين الآخر بعدم رغبته بالتجديد قبل ثلاثين يوماً من تاريخ انتهاء هذه الاتفاقية.</p><ol><li>الالتزامات</li><li>يلتزم الطرف الأول بما يأتي:</li><li>تقوم شركة رواد السرعة للصيانة بعرض معلومات وخدمات الطرف الثاني وتسويقها إلكترونياً عبر التطبيق الخاص بها.</li><li>تقوم شركة رواد السرعة للصيانة المعلومات وعبر تطبيق "صيانة إكسبرس  " بالسماح للطرف الثاني بالتفاعل مع طلبات الخدمات ، وتوفير البنية الإلكترونية اللازمة لذلك.</li><li>يلتزم الطرف الثاني بما يأتي:</li><li>يلتزم الطرف الثاني بتوفير عدد مناسب من العمال التابعين له لتقديم الخدمات   عبر تطبيق "صيانة إكسبرس  " فقط وذلك طوال مدة الاتفاقية، على أن تكون هذه الخدمات متوفرة على مدار 12 ساعة يومياً كحد ادنى.</li><li>يلتزم الطرف الثاني بالاستجابة للطلبات المقدمة عبر التطبيق متى ما كان ذلك ممكناً وتنفيذ الخدمة المطلوبة وفقاً للشروط والمواصفات التيتحددها شركة رواد السرعة للصيانة</li><li>يلتزم الطرف الثاني بعدم تحديد أجر الخدمة المقدمة إلا بعد زيارة العميل و الكشف عن العطل.</li><li>يلتزم الطرف الثاني بتقديم الخدمات عبر تطبيق "صيانة إكسبرس  " وفقاً للأجور المحددة والمتفق عليها بين الطرفين الموضحة في التطبيق و في حال وجود عروض و خصومات ، على أنه في حال وجود حاجة لتعديل الأسعار فإن الطرف الثاني يلتزم بإرسال إشعار شركة رواد السرعة للصيانة بذلك قبل 30 يوماً من تاريخ التعديل.</li><li>يلتزم الطرف الثاني باتخاذ كافة الإجراءات النظامية المتعلقة بالسلامة والأمان، أثناء تقديمة لكافة الخدمات التي ينفذها عبر تطبيق "صيانة إكسبرس  ".</li><li>يلتزم الطرف الثاني باتخاذ كافة الإجراءات النظامية المتعلقة بسلامة مستندات الخدمات وصلاحية تراخيصها، وكذلك سلامة مستندات العمال التابعين له وصلاحية تراخيصهم للقيام بهذه الأعمال.</li><li>يقبل الطرف الثاني ويوافق ويقر بإنشاء علاقة قانونية مباشرة بين الطرف الثاني وبين العميل فقط و يطلع بها كلُ منهما. لا تتحمل شركة رواد السرعة للصيانة المسئولية عن أي فعل أو امتناع أو سلوك للمستخدم تجاه الطرف الثاني والعمال التابع له والخدمة أو يتعلق بهم. يتحمل العامل التابع للطرف الثاني وحده مسئولية اتخاذ التدابير المعقولة والملائمة التي تتعلق بالغير ممن يتعاملون معه فيما يتعلق بتقديم الخدمات بدون الإخلال بحق الطرف الثاني إن وجد,في الرجوع على العامل التابع له ,يقر الطرف الثاني ويوافق على أنه سيظل في جميع الأوقات مسئولاُ عن أي فعل أو امتناع عن فعل من العامل التابع له تجاه العميل و شركة رواد السرعة للصيانة ،ويقر الطرف الثاني ويتعهد بأن يضمن امتثال العامل التابع له لشروط ومواصفات تقديم الخدمة المحددة من و الالتزام بها ومراعاتها.</li><li>يتحمل الطرف الثاني أي التزامات أو مسؤوليات تنشأ نتيجة قيامه بتنفيذ الخدمات عبر تطبيق "صيانة إكسبرس  " ، ويكون هو المسؤول في مواجهة العملاء عن أي أضرار تنشأ لهم نتيجة أي تقصير أو أخطاء تحدث بسبب العامل التابع له أو لأي سبب آخر.</li><li>يخطر الطرف الثاني على الفور شركة رواد السرعة للصيانة بأي مخالفة (مشكوك بها) أو استخدام غير ملائم للتطبيق أو البيانات.</li><li>يقر الطرف الثاني ويوافق على أن التطبيق أو الخدمة ,من وقت لآخر, قد تكون غير متوفرة (على سبيل المثال,بسبب الصيانة الدورية أو تحديث النظام) وأن شركة رواد السرعة للصيانة لا تضمن ولا يمكن أن تضمن توافر معين للتطبيق أو الخدمة أو حداٌ أدنى من توافرها.</li><li>ستطلب شركة رواد السرعة للصيانة من العملاء الذين استخدموا أحد خدمات الطرف الثاني عبر تطبيق صيانة اكسبريس التعليق على الخدمة المقدمة وإعطاء درجة للخدمة ولمقدمها. تحتفظ بحقها في نشر هذه التعليقات والدرجات على التطبيق أو موقع الويب (أو أي منصات أخرى تملكها أو تديرها أو تسيطر عليها).</li><li>يقر الطرف الثاني أن شركة رواد السرعة للصيانة هي موزع وليس ناشر لهذه التعليقات و الدرجات (دون أي التزام على عاتقها بالتحقق منها) وتحتفظ بحقها في رفض أو تحرير أو إزالة  أي مراجعات سيئة إذا كانت تلك المراجعات تتضمن تعليقات فاحشة أو تذكر اسم شخص أو تنتهك أي قوانين ولوائح أخرى معمول بها. لا تتحمل خارج المتطلبات القانونية أو التشريعية أي مسؤلية و تخلي مسؤليتها بموجب هذه الاتفاقية عن محتوى وعواقب (نشر أو توزيع) أي تعليقات أو درجات أو مراجعات أيا كانت.</li><li>في حالة وجود شكوى أو نزاع أو خلاف بين الطرف الثاني والعميل أو في الحالات الأخرى الملائمة التي يوجد فيها سبب منطقي لهذا الإفصاح,يجوز لشركة رواد السرعة للصيانة دون أن يكون مطلوب منها إلى المدى الذي تسمح القوانين و اللوائح المعمول بها أن تقدم إلى العميل والطرف الثاني والسلطات ذات الصلة أو أي منها البيانات ذات الصلة (بما في ذلك البيانات الشخصية) الخاصة بالطرف الثاني أو السائق أو العميل.</li><li>الإقرارات :</li></ol><p>6-1 يقر الطرف الثاني ويحصل على إقرار من العامل التابع له ، <strong>لشركة رواد السرعة</strong> للصيانة بأنهما طوال مدة هذه الاتفاقية:</p><ol><li>متمسكان وملتزمان وسيظلون متمسكين وملتزمين بجميع التصاريح والتراخيص وغيرها من الأذون الحكومية الضرورية لأداء الخدمة ومواصلة جهودهم وعملياتهم وأعمالهم على الحفاظ عليها.</li><li>يلتزمان بجميع القوانين واللوائح المحلية، ومن بينها القوانين المتعلقة بتشغيل الخدمات وأنهم سيكونون وحدهم المسؤولين عن أي مخالفات لتلك القوانين واللوائح المحلية.</li><li>أن لديهم رخص مزاولة الخدمة صالحة وأنه مرخص لهما بتقديمها  وفقاً للمستندات التي تم تقديمها  لـصيانة إكسبرس   من قبلهم ، وأن لديهم جميع التراخيص والاعتمادات والتصاريح الملائمة لتقديم الخدمات.</li><li>أن لديهما مستوى ملائم وحديث من الخبرات المعرفية والعملية التي تمكنهما من تقديم الخدمة.</li><li>يجوز لـصيانة إكسبرس    في أي وقت إخطار الطرف الثاني بأي تعديل أو تغيير مقترح لشروط هذا العقد أو الرسم المتفق عليه وفي حال فسخك لهذا العقد مع الاحتفاظ بالحقوق المستحقة لـصيانة إكسبرس   خلال مدة سبع أيام، فإنك تكون قد قبلت التغييرات التي يحتوي عليها إخطار التغيير. وفي حالة اعتراضك على التغييرات أو التعديلات التي يحتوي عليها أخطار التغيير, يجوز لـصيانة إكسبرس    إنهاء العقد المبرم معك لسبب مشروع بأثر فوري ودون الحاجة إلى تعويضك بأي صورة من الصور.</li><li>قيمة الاتفاقية وطريقة الدفع :</li><li>تستحق شركة رواد السرعة للصيانة عمولة تبلغ قيمتها ( 15%  )   عن كل خدمة يتم تنفيذها عبر تطبيق "صيانة إكسبرس  " بناء على هذه الاتفاقية.</li><li>يلتزم الطرف الثاني عند توقيع الاتفاقية و التسجيل في تطبيق صيانة اكسبريس بدفع مبلغ (300 ريال ) ثلاثمائة ريال رصيد عن كل خدمة يقدمها</li><li>تقوم شركة رواد السرعة للصيانة بسحب العمولة المستحقة لها من المبلغ المودع بعد إغلاق الطلب، ويعد الطلب مغلقا بعد استجابة الطرف الثاني لطلب العميل.</li><li>لن تقوم شركة رواد السرعة للصيانة بالسماح لمقدم خدمة بالظهور على منصة التطبيق في حال عدم توفر رصيد نقدي في الحساب الخاص به.</li><li>يتم اصدار فاتورة كل طلب  عبر تطبيق   صيانة إكسبرس  ولا يسمح لمزود الخدمة إعطاء العميل أي فاتورة باسمه</li><li>القوة القاهرة:</li></ol><p>لا يكون أي طرف مسئولاً عن الوفاء بالتزاماته الواردة في هذه الاتفاقية إذا كان ذلك الطرف واقعاً تحت تأثير القوة القاهرة الخارجة عن إرادته أو سيطرته ويستمر الإعفاء عن المسؤولية طوال فترة وقوع ذلك الطرف تحت تأثير القوة القاهرة على أن يتم إخطار الطرف الآخر لذلك الطرف خلال عشرة (10) أيام من تاريخ وقوعها، وفي حالة استمرار القوة القاهرة لفترة تتجاوز ثلاثين (30) يوماً يحق للطرفان الاتفاق على فسخ هذه الاتفاقية وتسوية الحقوق المتعلقة بها، وتعني القوة القاهرة أعلاه بصورة حصرية الظروف الطبيعية والمناخية القاسية مثل الهزات الأرضية والزلازل والبراكين والسيول العنيفة المعوقة، كما تعني الحروب والشغب والاضطرابات التي تمنع تنفيذ هذه الاتفاقية.</p><ol><li>إنهاء الاتفاقية:</li></ol><p>يحق لشركة رواد السرعة للصيانة ودون سابق إنذار انهاء هذه الاتفاقية بإرادته المنفردة ودون الحاجة إلى الرجوع للطرف الثاني أو إبداء أي أسباب لهذا الإنهاء.</p><ol><li>فسخ الاتفاقية:</li></ol><p>تعتبر هذه الاتفاقية مفسوخة في حال تحقق أي من الحالات التالية :</p><ol><li>‌مخالفة   أو إخلال أحد الطرفين  بمواد أو شروط أو بنود هذه الاتفاقية واستمرار الطرف المخل بالمخالفة لمدة خمسة عشر (15) يوماً بعد إخطاره كتابة من الطرف غير المخل بذلك، ويحتفظ الطرف غير المخل بحقه في المطالبة بالتعويضات اللازمة عن أي خسائر أو أضرار تلحق به نتيجة لذلك.</li><li>‌إذا اتفق الطرفان بشكل رضائي على فسخ الاتفاقية والعدول عنها، على أن يكون الاتفاق كتابياً ويوقع من الطرفان.</li><li>‌إذا اتخذ أحد الأطراف الخطوات أو الإجراءات التي تتعلق بتصفية أعماله التجارية أو أصبح ذلك الطرف معسراً اوتم إخضاعه لأي إجراءات مراقبة إدارية أو قضائية.</li><li>إخلاء مسؤولية:</li><li>لن تكون شركة رواد السرعة للصيانة مسئولة عن أية أضرار أو خسائر أو التزامات بما في ذلك على سبيل الذكر لا الحصر الأضرار أو الخسائر أو  الالتزامات المباشرة وغير المباشرة أو الخاصة أو العرضية أو الناشئة فيما يتعلق بعدم التزام العميل (العملاء) بدفع التكاليف إلى مقدم الخدمة وما ينشأ عن ذلك، ولا يحق للطرف الثاني المطالبة بأي تعويضات في هذا الشأن، ولا تكون مسؤولة عن تعويض مقدم الخدمة عن أي خسائر أو أضرار جراء ذلك، كما لا تكون مسؤولة عن أية أضرار أو خسائر أو مصاريف تنشأ عن استخدامه لتطبيق "صيانة إكسبرس  " أو اعتماده على أو عدم إمكانية استخدامه للمعلومات والمواد والمنتجات والخدمات المتوفرة على التطبيق، أو فيما يتعلق بأي فشل  في الأداء أو خطأ أو سهو أو انقطاع أو تعطل أو تأخر في التشغيل أو البث أو بسبب فيروسات الكمبيوتر أو تعطل الخطوط أو الأنظمة حتى ولو تم إبلاغ شركة رواد السرعة للصيانة من قبلكم باحتمال حصول تلك الأضرار أو الخسائر أو المصاريف.</li><li>لن تكون شركة رواد السرعة للصيانة مسئولة عن أية أضرار أو خسائر أو التزامات بما في ذلك على سبيل الذكر لا الحصر الأضرار أو الخسائر أو الالتزمات المباشرة وغير المباشرة أو الخاصة أو العرضية أو الناشئة فيما يتعلق بالخدمات التي يقدمها مقدم الخدمة للعميل وما قد ينتج عن ذلك من أخطاء أو تقصير أو خلافه، ويكون مقدم الخدمة مسؤولاً وحده أمام العميل عن أية أضرار أو خسائر قد تصيبه نتيجة لتنفيذ الخدمة، ويقر مقدم الخدمة بأن تطبيق "صيانة إكسبرس  " هو عبارة عن وسيط الكتروني فقط لتقديم الخدمة، وأنه يتحمل كافة المسؤولية الناشئة عن تنفيذ هذه الخدمات.</li><li>يوافق مقدم الخدمة على أن يعوض تطبيق  صيانة إكسبرس  ويدافع عنها ويبرئ ذمتها من أي مطالبات (محتملة) أو أضرار(محتملة) تلحق بالغير, بما في ذلك العميل ,تنشأ عن تقديم الخدمة. بمجرد تقديم الخدمة إلى العميل.</li><li>يوافق مقدم الخدمة ويتعهد ويضمن بتعويض والدفاع عن إبراء ذمة تطبيق  صيانة إكسبرس (وبناء على طلب شركة رواد السرعة للصيانة الجهات المرخصة لها ومورديها ومسؤليها ومديريها ومقاوليها من الباطن) من جميع المطالبات أو الطلبات أو المصروفات (بما في ذلك الرسوم القانونية) أو أضرار أو عقوبات أو غرامات أو مساهمات اجتماعية  أو ضرائب من الغير (بما في ذلك العملاء والجهات التنظيمية والسلطات الحكومية) تتعلق بصورة مباشرة بالاتفاقية, باستثناء ما يتعلق منها بأي انتهاك تٌلام علية شركة رواد السرعة للصيانة لآلتزامات الواردة في هذه الأتفاقية.</li><li>يوافق مقدم الخدمة صراحة على أنه لا يمكن اعتبار هذه الاتفاقية توظيف أو أن شركة رواد السرعة للصيانة هي وكيل لمقدم الخدمة ، وإنما تقدم تطبيق صيانة إكسبرس     إلى مقدم الخدمة على سبيل الحصر خدمة وساطة مقابل عمولة.</li><li>لا تكون شركة رواد السرعة للصيانة وتطبيق صيانة إكسبرس   مسئولة ولا تتحمل أي مسئولية قانونية عن أي نوع من أنواع الضرر أو الخسائر (بما في ذلك الخسائر المباشرة أو الغير مباشرة أو التبعية أو العقابية أو الخاصة) أو المطالبات أو الطلبات أو المصروفات (بما في ذلك الرسوم القانونية) أو الأضرار أو العقوبات أو الغرامات (بما في ذلك الغير) التي تتعلق بصورة مباشرة أو غير المباشرة باتفاقية مقدم الخدمة و يشمل ذلك (1) أي أضرار أو مخاطر ترتبط بتنفيذ اتفاقية مقدم الخدمة (2) أي عمل أو امتناع عن عمل من جانب العميل (بما في ذلك السداد) (3) محتوى و تبعات (نشر أو توزيع) أي تعليقات أو تقييمات أو مراجعات بشأن مقدم الخدمة (4) إنهاء اتفاقية مقدم الخدمة لأي سبب كان.</li><li>تسري جميع الدفوع بما في ذلك قيود المسئولية واستثناءاتها التي تكون في شركة رواد السرعة للصيانة بغض النظر عن السبب الذي تستند إليه المسئولية القانونية (سواء كان تخلف عن الدفع أو مسئولية تقصيرية أو غير ذلك) , بغض النظر عن نوع مخالفة الالتزام (الضمانات أو الالتزامات التعاقدية أو غير ذلك), على جميع الأحداث وجميع الاتفاقيات معاٌ, إلى مدى عدم وقوع أي سوء سلوك متعمد أو إهمال جسيم من شركة رواد السرعة للصيانة أو إدارتها ,وكذلك لصالح موظفيها ,وبناء على طلب  شركة رواد السرعة للصيانة العامة لصالح جهات ترخيص مؤسسة عين العين للمقاولات العامة و مورديها و مقاوليها من الباطن</li><li>حقوق الملكية الفكرية :</li><li>جميع حقوق الملكية الفكرية و الأدبية الخاصة بتطبيق "صيانة إكسبرس  " موضوع هذه الاتفاقية وعلامته التجارية هي ملك خالص شركة رواد السرعة للصيانة المالكة لتطبيق  صيانة إكسبرس   فقط و لا يحق لأحد استخدامها أو استغلالها بأي شكل من الأشكال.</li><li>سرية المعلومات:</li><li>يلتزم الطرفان بموجب هذه الاتفاقية بحماية المعلومات السرية وبالمحافظة على سرية كافة المعلومات والبيانات الخاصة بالطرفين، أياً كانت طبيعتها أو نوعها التي حصل أو قد يحصل عليها من الاخر سواء بشكل مباشر أو غير مباشر وفي أي صورة كانت</li><li>يلتزم الطرف الثاني بالمحافظة على السرية وعدم الإفصاح بشأن الخدمات المقدمة إلى العميل والمعلومات الخاصة به، كما يلتزم بعدم استخدام المعلومات الخاصة بالعملاء من قبله أو من قبل أي طرف ثالث مالم يحصل على موافقة خطية صريحة بذلك.</li><li>القانون الواجب تطبيقه وتسوية الخلافات:</li></ol><p>تخضع هذه الاتفاقية في تفسيرها وتطبيقها للأنظمة والقوانين واللوائح السارية المفعول في المملكة العربية السعودية. و كل خلاف ينشأ بين الطرف ويتعذر حله ودياً خلال ستين يوماً يحال إلى الجهة القضائية المختصة في المملكة العربية السعودية للبت فيه بحكم نهائي ملزم للطرفين </p><ol><li>الإشعارات:</li></ol><p>أي إشعار أو موافقة أو طلب أو مطالبة أو مطلب أو تعليمات أو أي اتصال آخر يعطي أو يوجه بموجب هذه الاتفاقية سوف يعتبر أنه قد أعطي وتم تقديمه بشكل مناسب إذا كان خطياً وتم إرساله بالبريد المسجل المدفوع الأجر مسبقاً أو بواسطة شركة خدمات البريد السريع (مع إيصال إثبات الإرسال) أو بواسطة فاكس تم تسليمه أو إرساله إلى الطرف ذي العلاقة أو بواسطة البريد الإلكتروني </p><p>بناء على ماتم توضيحه في مقدمة هذه الاتفاقية من عناوين أو كما يتم تبليغه من قبل أي طرف إلى الطرف الآخر من حين لآخر بواسطة إشعار وفقاً لهذا الشرط.</p><p>ويلتزم كلا الطرفين بإبلاغ الطرف الاخر في حال اجراء أي تعدل على عنوانه، والا فان العنوان المبين في مقدمة هذه الاتفاقية هو العنوان الصحيح لكلا الطرفين.</p><ol><li>نسخ الاتفاقية:</li></ol><p>حررت هذه الاتفاقية من نسختين أصليتين وقد استلم كل طرف نسخة موقعة حسب الأصول، للعمل بموجبها.</p><p>وإثباتا لما تقدم، تم توقيع هذه الاتفاقية في التاريخ المذكور في مقدمتها.</p><p> </p><p> </p><p> </p><figure class="table"><table><tbody><tr><td>الطرف الاول</td><td>الطرف الثاني</td></tr><tr><td> </td><td> </td></tr></tbody></table></figure><p> </p><p> </p><p> </p><p> </p><p> </p><p> </p><p> </p><p> </p><p> </p>', '<p><strong>اتفاقية تعاون</strong></p><p>بعون الله وتوفيقه، تم توقيع اتفاقية التعاون هذه "الاتفاقية" يوم ____ بتاريخ __/__/_144هـ الموافق __/__/_202م بين كل من :</p><ol><li>شركة رواد السرعة للصيانة والقائمة بسجل تجاري رقم 4030438632))، وعنوان مركزها الرئيسي في جدة حي الحمدانية ص.ب 6706  الرمز البريدي 21452,عنوان البريد الالكتروني (ashaikhi@@hotmail.com )، ويمثلها في التوقيع على هذه الاتفاقية السيد/ سعد علي الشيخي بصفته المدير التنفيذي ويشار إليها فيما بعد لأغراض هذه الاتفاقية  بـالطرف الاول.</li><li>______________________ ، سجل تجاري رقم (__________)، وعنوانها ______________جوال رقم: __________، عنوان البريد الإلكتروني __________ جوال __________،ويمثلها في التوقيع</li></ol><p>لسيد / ________هوية رقم _______ ، بصفته ..............</p><p>ويشار إليها فيما بعد لأغراض هذه الاتفاقية  بـ (الطرف الثاني).ويشار إليهما مجتمعين بـ (الطرفان" أو "الطرفين).</p><p>التمهيد</p><p>حيث أن شركة رواد السرعة للصيانة هي شركة تجارية تمتلك تطبيق "صيانة إكسبرس  " والذي هو عبارة عن منصة الكترونية تجمع بين مقدمي خدمات وبين العملاء المستخدمين للتطبيق "التطبيق" ، حيث تسمح لمقدمي خدمة بالاتصال بالعملاء مستخدمي التطبيق وتقديم الخدمات لهم وفقاً لما يتيحه التطبيق. </p><p>وحيث أن الطرف الثاني هو مؤسسة تعمل في مجال تقديم خدمات (.________________________ )، ولديه الخبرة والقدرة والإمكانيات اللازمة لتقديم الخدمات عن طريق تطبيق "صيانة إكسبرس " ، ويرغب في تقديم خدماته من خلال التطبيق الخاص بالطرف الأول "صيانة إكسبرس </p><p>وحيث أبدى الطرفان رغبتهما في التعاون معا فقد اتفقا فيما بينهما على الآتي : </p><ol><li>التمهيد:</li></ol><p> يعتبر التمهيد السابق وأي ملاحق تضاف لهذه الاتفاقية هي جزء لايتجزأ من هذه الاتفاقية يقرأ ويفسر معها.</p><ol><li>موضوع الاتفاقية:</li></ol><p>3-1 اتفق الطرفان على أن تتيح شركة رواد السرعة للصيانة للطرف الثاني عرض وتقديم الخدمات عبر تطبيق "صيانة إكسبرس  " في مقابل أن تحصل على عمولة مقابل أي خدمة يتم تقديمها لعملاء التطبيق، مع التزام الطرف الثاني بشروط تقديم الخدمة المحددة من قبل شركة رواد السرعة للصيانة في هذه الاتفاقية.</p><ol><li>مدة الاتفاقية:</li></ol><p>اتفق الطرفان على أن تكون مدة هذه الاتفاقية سنة واحدة ابتداء من تاريخ التوقيع عليها، ويتم تجديد هذه المدة تلقائياً لمدد أخرى مماثلة ما لم يخطر أحد الطرفين الآخر بعدم رغبته بالتجديد قبل ثلاثين يوماً من تاريخ انتهاء هذه الاتفاقية.</p><ol><li>الالتزامات</li><li>يلتزم الطرف الأول بما يأتي:</li><li>تقوم شركة رواد السرعة للصيانة بعرض معلومات وخدمات الطرف الثاني وتسويقها إلكترونياً عبر التطبيق الخاص بها.</li><li>تقوم شركة رواد السرعة للصيانة المعلومات وعبر تطبيق "صيانة إكسبرس  " بالسماح للطرف الثاني بالتفاعل مع طلبات الخدمات ، وتوفير البنية الإلكترونية اللازمة لذلك.</li><li>يلتزم الطرف الثاني بما يأتي:</li><li>يلتزم الطرف الثاني بتوفير عدد مناسب من العمال التابعين له لتقديم الخدمات   عبر تطبيق "صيانة إكسبرس  " فقط وذلك طوال مدة الاتفاقية، على أن تكون هذه الخدمات متوفرة على مدار 12 ساعة يومياً كحد ادنى.</li><li>يلتزم الطرف الثاني بالاستجابة للطلبات المقدمة عبر التطبيق متى ما كان ذلك ممكناً وتنفيذ الخدمة المطلوبة وفقاً للشروط والمواصفات التيتحددها شركة رواد السرعة للصيانة</li><li>يلتزم الطرف الثاني بعدم تحديد أجر الخدمة المقدمة إلا بعد زيارة العميل و الكشف عن العطل.</li><li>يلتزم الطرف الثاني بتقديم الخدمات عبر تطبيق "صيانة إكسبرس  " وفقاً للأجور المحددة والمتفق عليها بين الطرفين الموضحة في التطبيق و في حال وجود عروض و خصومات ، على أنه في حال وجود حاجة لتعديل الأسعار فإن الطرف الثاني يلتزم بإرسال إشعار شركة رواد السرعة للصيانة بذلك قبل 30 يوماً من تاريخ التعديل.</li><li>يلتزم الطرف الثاني باتخاذ كافة الإجراءات النظامية المتعلقة بالسلامة والأمان، أثناء تقديمة لكافة الخدمات التي ينفذها عبر تطبيق "صيانة إكسبرس  ".</li><li>يلتزم الطرف الثاني باتخاذ كافة الإجراءات النظامية المتعلقة بسلامة مستندات الخدمات وصلاحية تراخيصها، وكذلك سلامة مستندات العمال التابعين له وصلاحية تراخيصهم للقيام بهذه الأعمال.</li><li>يقبل الطرف الثاني ويوافق ويقر بإنشاء علاقة قانونية مباشرة بين الطرف الثاني وبين العميل فقط و يطلع بها كلُ منهما. لا تتحمل شركة رواد السرعة للصيانة المسئولية عن أي فعل أو امتناع أو سلوك للمستخدم تجاه الطرف الثاني والعمال التابع له والخدمة أو يتعلق بهم. يتحمل العامل التابع للطرف الثاني وحده مسئولية اتخاذ التدابير المعقولة والملائمة التي تتعلق بالغير ممن يتعاملون معه فيما يتعلق بتقديم الخدمات بدون الإخلال بحق الطرف الثاني إن وجد,في الرجوع على العامل التابع له ,يقر الطرف الثاني ويوافق على أنه سيظل في جميع الأوقات مسئولاُ عن أي فعل أو امتناع عن فعل من العامل التابع له تجاه العميل و شركة رواد السرعة للصيانة ،ويقر الطرف الثاني ويتعهد بأن يضمن امتثال العامل التابع له لشروط ومواصفات تقديم الخدمة المحددة من و الالتزام بها ومراعاتها.</li><li>يتحمل الطرف الثاني أي التزامات أو مسؤوليات تنشأ نتيجة قيامه بتنفيذ الخدمات عبر تطبيق "صيانة إكسبرس  " ، ويكون هو المسؤول في مواجهة العملاء عن أي أضرار تنشأ لهم نتيجة أي تقصير أو أخطاء تحدث بسبب العامل التابع له أو لأي سبب آخر.</li><li>يخطر الطرف الثاني على الفور شركة رواد السرعة للصيانة بأي مخالفة (مشكوك بها) أو استخدام غير ملائم للتطبيق أو البيانات.</li><li>يقر الطرف الثاني ويوافق على أن التطبيق أو الخدمة ,من وقت لآخر, قد تكون غير متوفرة (على سبيل المثال,بسبب الصيانة الدورية أو تحديث النظام) وأن شركة رواد السرعة للصيانة لا تضمن ولا يمكن أن تضمن توافر معين للتطبيق أو الخدمة أو حداٌ أدنى من توافرها.</li><li>ستطلب شركة رواد السرعة للصيانة من العملاء الذين استخدموا أحد خدمات الطرف الثاني عبر تطبيق صيانة اكسبريس التعليق على الخدمة المقدمة وإعطاء درجة للخدمة ولمقدمها. تحتفظ بحقها في نشر هذه التعليقات والدرجات على التطبيق أو موقع الويب (أو أي منصات أخرى تملكها أو تديرها أو تسيطر عليها).</li><li>يقر الطرف الثاني أن شركة رواد السرعة للصيانة هي موزع وليس ناشر لهذه التعليقات و الدرجات (دون أي التزام على عاتقها بالتحقق منها) وتحتفظ بحقها في رفض أو تحرير أو إزالة  أي مراجعات سيئة إذا كانت تلك المراجعات تتضمن تعليقات فاحشة أو تذكر اسم شخص أو تنتهك أي قوانين ولوائح أخرى معمول بها. لا تتحمل خارج المتطلبات القانونية أو التشريعية أي مسؤلية و تخلي مسؤليتها بموجب هذه الاتفاقية عن محتوى وعواقب (نشر أو توزيع) أي تعليقات أو درجات أو مراجعات أيا كانت.</li><li>في حالة وجود شكوى أو نزاع أو خلاف بين الطرف الثاني والعميل أو في الحالات الأخرى الملائمة التي يوجد فيها سبب منطقي لهذا الإفصاح,يجوز لشركة رواد السرعة للصيانة دون أن يكون مطلوب منها إلى المدى الذي تسمح القوانين و اللوائح المعمول بها أن تقدم إلى العميل والطرف الثاني والسلطات ذات الصلة أو أي منها البيانات ذات الصلة (بما في ذلك البيانات الشخصية) الخاصة بالطرف الثاني أو السائق أو العميل.</li><li>الإقرارات :</li></ol><p>6-1 يقر الطرف الثاني ويحصل على إقرار من العامل التابع له ، <strong>لشركة رواد السرعة</strong> للصيانة بأنهما طوال مدة هذه الاتفاقية:</p><ol><li>متمسكان وملتزمان وسيظلون متمسكين وملتزمين بجميع التصاريح والتراخيص وغيرها من الأذون الحكومية الضرورية لأداء الخدمة ومواصلة جهودهم وعملياتهم وأعمالهم على الحفاظ عليها.</li><li>يلتزمان بجميع القوانين واللوائح المحلية، ومن بينها القوانين المتعلقة بتشغيل الخدمات وأنهم سيكونون وحدهم المسؤولين عن أي مخالفات لتلك القوانين واللوائح المحلية.</li><li>أن لديهم رخص مزاولة الخدمة صالحة وأنه مرخص لهما بتقديمها  وفقاً للمستندات التي تم تقديمها  لـصيانة إكسبرس   من قبلهم ، وأن لديهم جميع التراخيص والاعتمادات والتصاريح الملائمة لتقديم الخدمات.</li><li>أن لديهما مستوى ملائم وحديث من الخبرات المعرفية والعملية التي تمكنهما من تقديم الخدمة.</li><li>يجوز لـصيانة إكسبرس    في أي وقت إخطار الطرف الثاني بأي تعديل أو تغيير مقترح لشروط هذا العقد أو الرسم المتفق عليه وفي حال فسخك لهذا العقد مع الاحتفاظ بالحقوق المستحقة لـصيانة إكسبرس   خلال مدة سبع أيام، فإنك تكون قد قبلت التغييرات التي يحتوي عليها إخطار التغيير. وفي حالة اعتراضك على التغييرات أو التعديلات التي يحتوي عليها أخطار التغيير, يجوز لـصيانة إكسبرس    إنهاء العقد المبرم معك لسبب مشروع بأثر فوري ودون الحاجة إلى تعويضك بأي صورة من الصور.</li><li>قيمة الاتفاقية وطريقة الدفع :</li><li>تستحق شركة رواد السرعة للصيانة عمولة تبلغ قيمتها ( 15%  )   عن كل خدمة يتم تنفيذها عبر تطبيق "صيانة إكسبرس  " بناء على هذه الاتفاقية.</li><li>يلتزم الطرف الثاني عند توقيع الاتفاقية و التسجيل في تطبيق صيانة اكسبريس بدفع مبلغ (300 ريال ) ثلاثمائة ريال رصيد عن كل خدمة يقدمها</li><li>تقوم شركة رواد السرعة للصيانة بسحب العمولة المستحقة لها من المبلغ المودع بعد إغلاق الطلب، ويعد الطلب مغلقا بعد استجابة الطرف الثاني لطلب العميل.</li><li>لن تقوم شركة رواد السرعة للصيانة بالسماح لمقدم خدمة بالظهور على منصة التطبيق في حال عدم توفر رصيد نقدي في الحساب الخاص به.</li><li>يتم اصدار فاتورة كل طلب  عبر تطبيق   صيانة إكسبرس  ولا يسمح لمزود الخدمة إعطاء العميل أي فاتورة باسمه</li><li>القوة القاهرة:</li></ol><p>لا يكون أي طرف مسئولاً عن الوفاء بالتزاماته الواردة في هذه الاتفاقية إذا كان ذلك الطرف واقعاً تحت تأثير القوة القاهرة الخارجة عن إرادته أو سيطرته ويستمر الإعفاء عن المسؤولية طوال فترة وقوع ذلك الطرف تحت تأثير القوة القاهرة على أن يتم إخطار الطرف الآخر لذلك الطرف خلال عشرة (10) أيام من تاريخ وقوعها، وفي حالة استمرار القوة القاهرة لفترة تتجاوز ثلاثين (30) يوماً يحق للطرفان الاتفاق على فسخ هذه الاتفاقية وتسوية الحقوق المتعلقة بها، وتعني القوة القاهرة أعلاه بصورة حصرية الظروف الطبيعية والمناخية القاسية مثل الهزات الأرضية والزلازل والبراكين والسيول العنيفة المعوقة، كما تعني الحروب والشغب والاضطرابات التي تمنع تنفيذ هذه الاتفاقية.</p><ol><li>إنهاء الاتفاقية:</li></ol><p>يحق لشركة رواد السرعة للصيانة ودون سابق إنذار انهاء هذه الاتفاقية بإرادته المنفردة ودون الحاجة إلى الرجوع للطرف الثاني أو إبداء أي أسباب لهذا الإنهاء.</p><ol><li>فسخ الاتفاقية:</li></ol><p>تعتبر هذه الاتفاقية مفسوخة في حال تحقق أي من الحالات التالية :</p><ol><li>‌مخالفة   أو إخلال أحد الطرفين  بمواد أو شروط أو بنود هذه الاتفاقية واستمرار الطرف المخل بالمخالفة لمدة خمسة عشر (15) يوماً بعد إخطاره كتابة من الطرف غير المخل بذلك، ويحتفظ الطرف غير المخل بحقه في المطالبة بالتعويضات اللازمة عن أي خسائر أو أضرار تلحق به نتيجة لذلك.</li><li>‌إذا اتفق الطرفان بشكل رضائي على فسخ الاتفاقية والعدول عنها، على أن يكون الاتفاق كتابياً ويوقع من الطرفان.</li><li>‌إذا اتخذ أحد الأطراف الخطوات أو الإجراءات التي تتعلق بتصفية أعماله التجارية أو أصبح ذلك الطرف معسراً اوتم إخضاعه لأي إجراءات مراقبة إدارية أو قضائية.</li><li>إخلاء مسؤولية:</li><li>لن تكون شركة رواد السرعة للصيانة مسئولة عن أية أضرار أو خسائر أو التزامات بما في ذلك على سبيل الذكر لا الحصر الأضرار أو الخسائر أو  الالتزامات المباشرة وغير المباشرة أو الخاصة أو العرضية أو الناشئة فيما يتعلق بعدم التزام العميل (العملاء) بدفع التكاليف إلى مقدم الخدمة وما ينشأ عن ذلك، ولا يحق للطرف الثاني المطالبة بأي تعويضات في هذا الشأن، ولا تكون مسؤولة عن تعويض مقدم الخدمة عن أي خسائر أو أضرار جراء ذلك، كما لا تكون مسؤولة عن أية أضرار أو خسائر أو مصاريف تنشأ عن استخدامه لتطبيق "صيانة إكسبرس  " أو اعتماده على أو عدم إمكانية استخدامه للمعلومات والمواد والمنتجات والخدمات المتوفرة على التطبيق، أو فيما يتعلق بأي فشل  في الأداء أو خطأ أو سهو أو انقطاع أو تعطل أو تأخر في التشغيل أو البث أو بسبب فيروسات الكمبيوتر أو تعطل الخطوط أو الأنظمة حتى ولو تم إبلاغ شركة رواد السرعة للصيانة من قبلكم باحتمال حصول تلك الأضرار أو الخسائر أو المصاريف.</li><li>لن تكون شركة رواد السرعة للصيانة مسئولة عن أية أضرار أو خسائر أو التزامات بما في ذلك على سبيل الذكر لا الحصر الأضرار أو الخسائر أو الالتزمات المباشرة وغير المباشرة أو الخاصة أو العرضية أو الناشئة فيما يتعلق بالخدمات التي يقدمها مقدم الخدمة للعميل وما قد ينتج عن ذلك من أخطاء أو تقصير أو خلافه، ويكون مقدم الخدمة مسؤولاً وحده أمام العميل عن أية أضرار أو خسائر قد تصيبه نتيجة لتنفيذ الخدمة، ويقر مقدم الخدمة بأن تطبيق "صيانة إكسبرس  " هو عبارة عن وسيط الكتروني فقط لتقديم الخدمة، وأنه يتحمل كافة المسؤولية الناشئة عن تنفيذ هذه الخدمات.</li><li>يوافق مقدم الخدمة على أن يعوض تطبيق  صيانة إكسبرس  ويدافع عنها ويبرئ ذمتها من أي مطالبات (محتملة) أو أضرار(محتملة) تلحق بالغير, بما في ذلك العميل ,تنشأ عن تقديم الخدمة. بمجرد تقديم الخدمة إلى العميل.</li><li>يوافق مقدم الخدمة ويتعهد ويضمن بتعويض والدفاع عن إبراء ذمة تطبيق  صيانة إكسبرس (وبناء على طلب شركة رواد السرعة للصيانة الجهات المرخصة لها ومورديها ومسؤليها ومديريها ومقاوليها من الباطن) من جميع المطالبات أو الطلبات أو المصروفات (بما في ذلك الرسوم القانونية) أو أضرار أو عقوبات أو غرامات أو مساهمات اجتماعية  أو ضرائب من الغير (بما في ذلك العملاء والجهات التنظيمية والسلطات الحكومية) تتعلق بصورة مباشرة بالاتفاقية, باستثناء ما يتعلق منها بأي انتهاك تٌلام علية شركة رواد السرعة للصيانة لآلتزامات الواردة في هذه الأتفاقية.</li><li>يوافق مقدم الخدمة صراحة على أنه لا يمكن اعتبار هذه الاتفاقية توظيف أو أن شركة رواد السرعة للصيانة هي وكيل لمقدم الخدمة ، وإنما تقدم تطبيق صيانة إكسبرس     إلى مقدم الخدمة على سبيل الحصر خدمة وساطة مقابل عمولة.</li><li>لا تكون شركة رواد السرعة للصيانة وتطبيق صيانة إكسبرس   مسئولة ولا تتحمل أي مسئولية قانونية عن أي نوع من أنواع الضرر أو الخسائر (بما في ذلك الخسائر المباشرة أو الغير مباشرة أو التبعية أو العقابية أو الخاصة) أو المطالبات أو الطلبات أو المصروفات (بما في ذلك الرسوم القانونية) أو الأضرار أو العقوبات أو الغرامات (بما في ذلك الغير) التي تتعلق بصورة مباشرة أو غير المباشرة باتفاقية مقدم الخدمة و يشمل ذلك (1) أي أضرار أو مخاطر ترتبط بتنفيذ اتفاقية مقدم الخدمة (2) أي عمل أو امتناع عن عمل من جانب العميل (بما في ذلك السداد) (3) محتوى و تبعات (نشر أو توزيع) أي تعليقات أو تقييمات أو مراجعات بشأن مقدم الخدمة (4) إنهاء اتفاقية مقدم الخدمة لأي سبب كان.</li><li>تسري جميع الدفوع بما في ذلك قيود المسئولية واستثناءاتها التي تكون في شركة رواد السرعة للصيانة بغض النظر عن السبب الذي تستند إليه المسئولية القانونية (سواء كان تخلف عن الدفع أو مسئولية تقصيرية أو غير ذلك) , بغض النظر عن نوع مخالفة الالتزام (الضمانات أو الالتزامات التعاقدية أو غير ذلك), على جميع الأحداث وجميع الاتفاقيات معاٌ, إلى مدى عدم وقوع أي سوء سلوك متعمد أو إهمال جسيم من شركة رواد السرعة للصيانة أو إدارتها ,وكذلك لصالح موظفيها ,وبناء على طلب  شركة رواد السرعة للصيانة العامة لصالح جهات ترخيص مؤسسة عين العين للمقاولات العامة و مورديها و مقاوليها من الباطن</li><li>حقوق الملكية الفكرية :</li><li>جميع حقوق الملكية الفكرية و الأدبية الخاصة بتطبيق "صيانة إكسبرس  " موضوع هذه الاتفاقية وعلامته التجارية هي ملك خالص شركة رواد السرعة للصيانة المالكة لتطبيق  صيانة إكسبرس   فقط و لا يحق لأحد استخدامها أو استغلالها بأي شكل من الأشكال.</li><li>سرية المعلومات:</li><li>يلتزم الطرفان بموجب هذه الاتفاقية بحماية المعلومات السرية وبالمحافظة على سرية كافة المعلومات والبيانات الخاصة بالطرفين، أياً كانت طبيعتها أو نوعها التي حصل أو قد يحصل عليها من الاخر سواء بشكل مباشر أو غير مباشر وفي أي صورة كانت</li><li>يلتزم الطرف الثاني بالمحافظة على السرية وعدم الإفصاح بشأن الخدمات المقدمة إلى العميل والمعلومات الخاصة به، كما يلتزم بعدم استخدام المعلومات الخاصة بالعملاء من قبله أو من قبل أي طرف ثالث مالم يحصل على موافقة خطية صريحة بذلك.</li><li>القانون الواجب تطبيقه وتسوية الخلافات:</li></ol><p>تخضع هذه الاتفاقية في تفسيرها وتطبيقها للأنظمة والقوانين واللوائح السارية المفعول في المملكة العربية السعودية. و كل خلاف ينشأ بين الطرف ويتعذر حله ودياً خلال ستين يوماً يحال إلى الجهة القضائية المختصة في المملكة العربية السعودية للبت فيه بحكم نهائي ملزم للطرفين </p><ol><li>الإشعارات:</li></ol><p>أي إشعار أو موافقة أو طلب أو مطالبة أو مطلب أو تعليمات أو أي اتصال آخر يعطي أو يوجه بموجب هذه الاتفاقية سوف يعتبر أنه قد أعطي وتم تقديمه بشكل مناسب إذا كان خطياً وتم إرساله بالبريد المسجل المدفوع الأجر مسبقاً أو بواسطة شركة خدمات البريد السريع (مع إيصال إثبات الإرسال) أو بواسطة فاكس تم تسليمه أو إرساله إلى الطرف ذي العلاقة أو بواسطة البريد الإلكتروني </p><p>بناء على ماتم توضيحه في مقدمة هذه الاتفاقية من عناوين أو كما يتم تبليغه من قبل أي طرف إلى الطرف الآخر من حين لآخر بواسطة إشعار وفقاً لهذا الشرط.</p><p>ويلتزم كلا الطرفين بإبلاغ الطرف الاخر في حال اجراء أي تعدل على عنوانه، والا فان العنوان المبين في مقدمة هذه الاتفاقية هو العنوان الصحيح لكلا الطرفين.</p><ol><li>نسخ الاتفاقية:</li></ol><p>حررت هذه الاتفاقية من نسختين أصليتين وقد استلم كل طرف نسخة موقعة حسب الأصول، للعمل بموجبها.</p><p>وإثباتا لما تقدم، تم توقيع هذه الاتفاقية في التاريخ المذكور في مقدمتها.</p><p> </p><p> </p><p> </p><figure class="table"><table><tbody><tr><td>الطرف الاول</td><td>الطرف الثاني</td></tr><tr><td> </td><td> </td></tr></tbody></table></figure><p> </p><p> </p><p> </p><p> </p><p> </p><p> </p><p> </p><p> </p><p> </p>');
